webpackJsonp([20179978574060],{1268:function(e,t){e.exports={data:{markdownRemark:{html:'<p>As often as possible, I like to take the time to emulate some of the interaction designs that I like most. This time, I chose the interactive timeline <a href="http://www.nytimes.com/ref/business/20070715_GILDED_GRAPHIC.html" title="The Wealthiest Americans Ever NYT">“The Wealthiest Americans Ever” from the New York Times.</a></p>\n<figure>\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 810px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 70.16632016632018%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Wealthiest Americans Ever interactive timeline" title="" src="/static/wealthies-americans-timeline-82a50214c3ffb938c40314bdfb91070d-1626e.png" srcset="/static/wealthies-americans-timeline-82a50214c3ffb938c40314bdfb91070d-076ec.png 203w,\n/static/wealthies-americans-timeline-82a50214c3ffb938c40314bdfb91070d-7ae34.png 405w,\n/static/wealthies-americans-timeline-82a50214c3ffb938c40314bdfb91070d-1626e.png 810w,\n/static/wealthies-americans-timeline-82a50214c3ffb938c40314bdfb91070d-1523b.png 962w" sizes="(max-width: 810px) 100vw, 810px">\n    </span>\n  </span>\n  \n  <figcaption> A cool and informative interactive timeline that uses rollover effects</figcaption>\n</figure>\n<p>I created mine using Lectora Inspire and some images and info from <a href="http://muppet.wikia.com/wiki/Muppet_Wiki" title="Muppet Wiki">the Muppet Wiki</a></p>\n<figure>\n  <a href="http://www.knanthony.com/showcase/muppettime/index.html" target="blank">\n    \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 810px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 61.57735085945399%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Muppet timeline" title="" src="/static/muppet-timeline-ece011309a0e41813dd79bdc6aed0d0f-1626e.png" srcset="/static/muppet-timeline-ece011309a0e41813dd79bdc6aed0d0f-076ec.png 203w,\n/static/muppet-timeline-ece011309a0e41813dd79bdc6aed0d0f-7ae34.png 405w,\n/static/muppet-timeline-ece011309a0e41813dd79bdc6aed0d0f-1626e.png 810w,\n/static/muppet-timeline-ece011309a0e41813dd79bdc6aed0d0f-11024.png 989w" sizes="(max-width: 810px) 100vw, 810px">\n    </span>\n  </span>\n  \n  </a>\n  <figcaption>Take a look at the demo</figcaption>\n</figure>\n<p>This could be a great template for a timeline interaction (of course!) but also for introducing other things like dramatis personae, types of instruments, etc. Instead of the individual popups, I could also see this design being used to roll over individual parts of a larger image, like highlighting the members of the Muppet gang in a group shot.</p>',frontmatter:{date:"September 20, 2014",path:"/blog/weekend-project-interactive-timeline",title:"Weekend Project: Interactive Timeline",tags:["interaction","Lectora","muppets","project","template","timeline"],categories:["elearning","Weekend Project"],featured:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.6239737274220032,src:"/static/muppet-timeline-ece011309a0e41813dd79bdc6aed0d0f-81d39.png",srcSet:"/static/muppet-timeline-ece011309a0e41813dd79bdc6aed0d0f-9a8d1.png 203w,\n/static/muppet-timeline-ece011309a0e41813dd79bdc6aed0d0f-c53f9.png 405w,\n/static/muppet-timeline-ece011309a0e41813dd79bdc6aed0d0f-81d39.png 810w,\n/static/muppet-timeline-ece011309a0e41813dd79bdc6aed0d0f-68632.png 989w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
